#점 그래프
monthly_mean_sc = ax1.scatter(df.resample('M').mean().index, df.resample('M').mean()['기온(°C)'])

##########################################################
import matplotlib.dates as dates
from scipy.interpolate import make_interp_spline
date_num = dates.date2num(df.resample('M').mean().index)

date_num_smooth = np.linspace(date_num.min(), 
                              date_num.max(), 100) 
spl = make_interp_spline(date_num, df.resample('M').mean()['기온(°C)'], k=3)
value_np_smooth = spl(date_num_smooth)

ax1.plot(dates.num2date(date_num_smooth), value_np_smooth, 
         label='monthly_mean interpolation')
###########################################################

#날짜시간 포멧
ax1.xaxis.set_major_locator(dates.MonthLocator())
ax1.xaxis.set_minor_locator(dates.MonthLocator(interval=1))
ax1.xaxis.set_major_formatter(dates.DateFormatter('%M'))
ax1.xaxis.set_minor_formatter(dates.DateFormatter('%M'))

# Make the y-axis label, ticks and tick labels match the line color.
ax1.set_ylabel('temperature (°C)', fontsize = 14)
ax1.tick_params('y', colors='r')

ax1.set_title("Monthly temperature variation (Mt. Kwanak, 2018)", 
          y=1.05,   # margin under the title.
          fontdict={'fontsize':18,'fontweight':'bold'})

#ax1.set_xticks(x)
